import React from "react";

export default function Home() {
  const options = {
    chart: {
      type: "spline"
    },
    title: {
      text: "My chart"
    },
    series: [
      {
        data: [1, 2, 1, 4, 3, 6]
      }
    ]
  };
  return (
    <div className="row">
      <div className="col col-12">
        <h1>Forside</h1>
        <div className="card" style={{ overflow: "hidden", width: "50%" }}>
          <div className="card-body"></div>
        </div>
      </div>
    </div>
  );
}
